(function ($, Drupal, drupalSettings) {

  window.addEventListener("load", () => {
    const contents = document.querySelectorAll('.lp-donate-today__image:not(.no-fade-animation)');
    if(contents.length > 1) {
      setTimeout(startFade, 3000);
      function startFade() {
        var contentsArray = [...contents];

        for(let i = 0; i < contentsArray.length; i++) {
          if(!contentsArray[i].classList.contains('fade-toggle')) {
            contentsArray[i].classList.add('fade-toggle');
            const next = i === contentsArray.length - 1 ? 0 : i + 1;
            contentsArray[next].classList.remove('fade-toggle');
            break;
          }
        }
        setTimeout(startFade, 3000);
      }
    }
  })

 })(jQuery, Drupal, drupalSettings);



(function ($, Drupal, drupalSettings) {

  const tabsSection = document.querySelector('.lp-tabs');

  if(tabsSection){
    initDefaultGallery();
  }

  function initDefaultGallery() {
    var panel = document.querySelector('[data-panel="1"]');
    sliderInitPerTab(panel);
  }

  function sliderInitPerTab(el) {
    var main = el.querySelector('.lp-tabs__gallery-slider');
    var thumbs = el.querySelector('.lp-tabs__gallery-thumbs');
    var initClass = 'slick-initialized';

    if(!main.classList.contains(initClass)) {
      $(main).slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        infinite: false,
        fade: true,
        rtl: tabsSection.closest('html').dir === 'rtl' ? true : false,
        asNavFor: thumbs
      });
    }

    if(!thumbs.classList.contains(initClass)) {
      $(thumbs).slick({
        slidesToShow: 3,
        slidesToScroll: 1,
        arrows: false,
        asNavFor: main,
        rtl: tabsSection.closest('html').dir === 'rtl' ? true : false,
        focusOnSelect: true,
        infinite: false,
      });
    }
  }


  const tabs = document.querySelectorAll('.lp-tabs__nav-tab');
  tabs.forEach(tab => {
    tab.addEventListener('click', () => {
      var panel = document.querySelector('[data-panel="' + tab.dataset.tab + '"]');
      setActive(tab);
      sliderInitPerTab(panel);
    })
  });


  function showPanels(tab) {
    tab.addEventListener('click', () => {
      let tabIndex = tab.getAttribute('data-tab');
      let panels = document.querySelectorAll('.lp-tabs__panel');

      panels.forEach(panel => {
        const panelIndex = panel.getAttribute('data-panel');
        if(panelIndex === tabIndex) {
          setActive(panel);
        }
      })
    })
  }

  function setActive(el) {

    sliderElements = el.parentElement.children;
    let slides = [...sliderElements];
    slides.forEach(function (sib) {
      sib.classList.remove('active');
    });
    slides.forEach(function (sib) {
      sib.classList.remove('active');
    });

    el.classList.add('active');
  };

  tabs.forEach(tab => {
    showPanels(tab);
  });

  if(window.innerWidth <= 768) {
    const accordionTitles = document.querySelectorAll('.lp-tabs__content-title');
    accordionTitles.forEach(title => {
      const body = title.nextElementSibling;
      const parent = title.closest('.lp-tabs__content');
      title.addEventListener('click', () => {
        parent.classList.toggle('open');
        parent.classList.contains('open') ? body.style.maxHeight = body.scrollHeight + 'px' : body.style.maxHeight = null;
      })
    })
  }

})(jQuery, Drupal, drupalSettings);



